import React from 'react';
import { Link } from 'react-router-dom';
import { FaHome, FaBlog, FaPlan, FaUser } from 'react-icons/fa';

function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li><Link to="/home"><FaHome /> Home</Link></li>
          <li><Link to="/blog"><FaBlog /> Blog</Link></li>
          <li><Link to="/plan"><FaPlan /> Plan</Link></li>
          <li><Link to="/profile"><FaUser /> Profile</Link></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
